import React from 'react';
import Header, {HeaderReports} from './Header.js';
import Home from "./Home";

class Report extends React.Component {
    render() {
        return (
            <article className="article">
            <div className="report-page">
                <h2>REPORT PAGE</h2>
                <HeaderReports/>

                // TODO GÖr om till en egen komponent ??
                // TODO Snyggare routing. Mer dynamsik?
                // TODO för att slippa impotera alla? kanske kommer bli bättre när datan är sparad i en databas

                <div className="report_content">
                    <Route path="/reports/week/1" component={week1}/>
                    <Route path="/reports/week/2" component={week2}/>
                    <Route path="/reports/week/3" component={week3}/>
                    <Route path="/reports/week/4" component={week4}/>
                    <Route path="/reports/week/5" component={week5}/>
                    <Route path="/reports/week/6" component={week6}/>
                    <Route path="/reports/week/7" component={week7}/>
                </div>
            </div>
            </article>
        )
    }
}

export default Report;
